import React from 'react';
import ReactDOM from 'react-dom';

const pagetitle = "Регистрация"
const textlogin = "Логин"
const textpassword = "Пароль"
const area = document.getElementById("inputs")


const InputItems = (
    <div className = "group">
        <h1>{textlogin}</h1>
        <input id = "InLogin" placeholder = {"Введите имя пользоателя"}></input>
        <h1>{textpassword}</h1>
        <input id = "InPassword" placeholder = {"Введите пароль"}></input>
        <button id ="LoginButton">Войти</button>
    </div>
)

const imgarea = document.getElementById("logo")
const Img = <img src="Image\logo.jpeg" id = "logoImg"></img>
const rootimg = ReactDOM.createRoot(imgarea)
rootimg.render(Img)

const Title = <h1>{"Название"}</h1>
const titlearea = document.getElementById("pagetitle")
const roottitle = ReactDOM.createRoot(titlearea)
roottitle.render(Title)

const root = ReactDOM.createRoot(area)
root.render(InputItems)
